func TestReplaceStrings(t *testing.T) {
	jsunfuck.fillMissingDigits()
	jsunfuck.fillMissingChars()
	jsunfuck.replaceMap()

	mappingCache := make(map[string]string)
	for k, v := range MAPPING {
		mappingCache[k] = v
	}

	jsunfuck.replaceStrings()

	for k, v := range MAPPING {
		if mappingCache[k] != v {
			want, err := vm.Run(mappingCache[k])
			if err != nil {
				t.Fatalf("Failed to interpret '%v' char encoding: %v", k, err)
			}

			got, err := vm.Run(v)
			if err != nil {
				t.Fatalf("Failed to interpret NEW '%v' char encoding: %v", k, err)
			}

			if got != want {
				t.Fatalf("Interpretation mismatch for `%v` char: NEW=%v, result=%v; OLD=%v, result=%v",
					k, v, got, mappingCache[k], want)
			}
		}
	}
}

